<P class="p0 ft0">KEBIJAKAN KESELAMATAN DAN KESEHATAN KERJA</P>
<P class="p1 ft1">PT PILARPERKASA PERSADA memiliki komitmen untuk mencapai penerapan K3 yang terbaik dan mengembangkan Sistem Manajemen Keselamatan dan Kesehatan Kerja dalam rangka mengurangi dan mengendalikan resiko K3.</P>
<P class="p2 ft1">Sistem Manajemen K3 PT PILARPERKASA PERSADA dibuat dan diimplementasikan dengan tujuan untuk melindungi tenaga kerja dan subkontraktor terhadap resiko K3 yang tidak dapat diterima.</P>
<P class="p3 ft1">Dalam rangka menjalankan komitmen ini, PT PILARPERKASA PERSADA akan :</P>
<P class="p4 ft1"><SPAN class="ft1">1.</SPAN><SPAN class="ft2">Bekerja dengan cara yang aman dan ramah lingkungan serta sesuai dengan peraturan perundangan K3 dan persyaratan K3 lainnya dari </SPAN><NOBR>pihak-pihak</NOBR> terkait.</P>
<P class="p5 ft1"><SPAN class="ft1">2.</SPAN><SPAN class="ft2">Menunjukkan kesesuaian dengan peraturan perundangan K3 sebagai persyaratan minimum dan mendukung pengembangan pengendalian K3 dengan standar yang lebih tinggi dari peraturan perundangan yang dikeluarkan oleh pemerintah setempat (nasional maupun lokal).</SPAN></P>
<P class="p6 ft1"><SPAN class="ft1">3.</SPAN><SPAN class="ft2">Memonitor dan </SPAN><NOBR>meng-audit</NOBR> kesesuaian pelaksanaan kegiatannya secara berkala dengan Sistem Manajemen K3, peraturan perundangan maupun standar yang ada.</P>
<P class="p7 ft1"><SPAN class="ft1">4.</SPAN><SPAN class="ft2">Memilih subkontraktor dan supplier yang dapat menunjukkan komitmen yang kontinyu terhadap pencegahan polusi dan penerapan K3 yang baik ketika melaksanakan pekerjaan mereka.</SPAN></P>
<P class="p7 ft1"><SPAN class="ft1">5.</SPAN><SPAN class="ft2">Melaksanakan inspeksi dan audit secara berkala terhadap subkontraktor dan supplier untuk memonitor pelaksanaan K3.</SPAN></P>
<P class="p5 ft1"><SPAN class="ft1">6.</SPAN><SPAN class="ft2">Mengupayakan usaha yang maksimal mengurangi resiko K3 dalam rangka mencapai sasaran K3 yaitu </SPAN><NOBR>zero-accident</NOBR> dengan selalu melakukan inspeksi dan peninjauan secara berkala untuk meningkatkan Kebijakan K3 dan Sistem Manajemen K3.</P>
<P class="p8 ft1"><SPAN class="ft1">7.</SPAN><SPAN class="ft2">Selalu aktif menyiapkan data kinerja mengenai implementasi Sistem Manajemen K3 bagi pihak- pihak terkait.</SPAN></P>
<P class="p9 ft1">Kami memiliki tanggung jawab yang cukup besar melalui Sistem Manajemen K3 ini. Sangatlah penting disadari bahwa kami semua hanyalah manusia biasa yang memiliki tekad mencapai penerapan K3 yang terbaik.</P>
<P class="p10 ft1">PT PILARPERKASA PERSADA</P>
<P class="p11 ft3">Teguh Irawan,ST.</P>
<P class="p12 ft1">Direktur Utama</P>
